import axios from 'axios';

class CategoryService {

    getAllCategories() {
        return axios.get(`https://fakestoreapi.com/products`)
    }

    getCategory(id) {
        return axios.get(`https://fakestoreapi.com/products/${id}`)
    }


}

export default new CategoryService()
